javascript:(function(){var url=window.location.href;var handle="";var channelMatch=url.match(/\/(?:\/)?(@[a-zA-Z0-9\._\-]+)/);var channelLink=document.querySelector('ytd-video-owner-renderer a[href*="/@"]');if(channelMatch&&!url.includes('/watch')){handle=channelMatch[1];}else if(channelLink){var href=channelLink.getAttribute('href');var handleMatch=href.match(/(@[a-zA-Z0-9\._\-]+)/);if(handleMatch)handle=handleMatch[1];}
if(!handle){var metaMatch=document.documentElement.innerHTML.match(/"@([a-zA-Z0-9\._\-]+)"/);if(metaMatch)handle="@"+metaMatch[1];}
if(!handle){alert("Kein YouTube-Handle gefunden. Bist du auf einer Video- oder Kanalseite?");return;}
var sbUrl="https://socialblade.com/youtube/handle/"+handle;window.open(sbUrl,'_blank');})();